import Table from "react-bootstrap/Table";
import "./ViewList.css";
import React from "react";
import Modal from "../Modal/Modal";

const ViewList = (props) => {
  let i = 1;
  return (
    <>
      <div className="container">
        <div className="mt-5">
          <Table striped bordered hover size="sm">
            <thead>
              <tr className="text-center">
                <th>#</th>
                <th>Name</th>
                <th>Last Name</th>
                <th>Email</th>
                <th>Age</th>
                <th>AmountDonate</th>
                <th>Update</th>
                <th>Delete</th>
              </tr>
            </thead>
            {props.items.map((obj) => (
              <tbody key={obj.id}>
                <tr>
                  <td>{i++}</td>
                  <td>{obj.name}</td>
                  <td>{obj.lastName}</td>
                  <td>{obj.email}</td>
                  <td>{obj.age}</td>
                  <td>{obj.amountDonate}</td>
                  <td>
                    <Modal
                      type="Update"
                      message="Amount Donate"
                      name={obj.name}
                      count={obj.amountDonate}
                    />
                  </td>
                </tr>
              </tbody>
            ))}
          </Table>
        </div>
      </div>
    </>
  );
};

export default ViewList;
